import React, { useState, useEffect } from "react";
import './App.css';


const App = () => {
  const [entries, setEntries] = useState([]);

  const apiURL = "https://strangers-things.herokuapp.com/api/2111-CSU-RM-WEB-PT/posts";
  // componentDidMount
  useEffect(() => {
    const getEntries = async() => {
      const resp = await fetch(apiURL);
      const result = await resp.json();

      setEntries(result.results);
    }
    getEntries();
  }, []);

  return <>
    <h1> STRANGER THINGS APP !</h1>
    {
      entries.map((posts, index) => {
        console.log('individual posts entries', posts);
        return <p key={index} posts={posts}></p>
      })
    }
  </>
}

export default App;
